import React, { Component } from 'react';
import {Table} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

class ListPage extends Component {
    
    render() {
        return (
            <Table>
                <thead>
                    <tr>
                        <th>NAME</th>
                        <th>ADDRESS</th>
                        <th>RATING</th>
                        <th>PICTURE</th>
                        <th>ACTION</th>
                    </tr>
                </thead>
            </Table>
        );
    }
}

export default ListPage;
